import React, { Component } from "react";
import styles from "../index.css";

class Buttons extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <React.Fragment>
        <main className={styles.button}>
          <button type="button" className="btn btn-primary">
            Gainers
          </button>
          <button type="button" className="btn btn-primary">
            Losers
          </button>
          <button type="button" className="btn btn-primary">
            All
          </button>
          <button type="button" className="btn btn-primary">
            Most Active
          </button>
        </main>
      </React.Fragment>
    );
  }
}

export default Buttons;
